import React from 'react';
import { useTranslation } from 'react-i18next';

const DentaltechnikWeber = () => {
    const { t } = useTranslation();

    const adressText = t('adress').split('\n').map((line, index) => (
        <React.Fragment key={index}>
            {line}
            <br />
        </React.Fragment>
    ));

    return (
        <section className="max-w-screen-2xl mx-auto flex flex-col justify-center mt-24 mb-32 px-8 md:px-16">
            <div className='w-full h-auto'>
                <img src="weber/weber_cover.webp" alt="Profile" className='object-contain w-full h-full' />
            </div>
            <div className='flex flex-row gap-8 mt-8'>
                <div>
                    <hr className='border-white/10 w-full mb-16'></hr>
                    <h2 className='mb-8 text-4xl w-full'>Dentaltechnik Weber</h2>
                </div>
                <div><div className='w-full h-auto'>
                    <img src="weber/weber_business_cards.webp" alt="Profile" className='object-contain w-full h-auto' />
                </div></div>
            </div>
        </section>
    );
}

export default DentaltechnikWeber;
